import React from "react";
import Header from "../components/Header";
import HeroSection from "../components/HeroSection";
import AnimalCard from "../components/AnimalCard";
import "./Home.css";

const Home = () => {
  const animals = [
    {
      name: "Junior",
      gender: "On",
      age: "Młody",
      size: "Średni",
      img: "/img/junior.jpg",
    },
    {
      name: "Tosia",
      gender: "Ona",
      age: "Senior",
      size: "Duża",
      img: "/img/tosia.jpg",
    },
    {
      name: "Heniek",
      gender: "On",
      age: "Dorosły",
      size: "Średni",
      img: "/img/heniek.jpg",
    },
    {
      name: "Bunia",
      gender: "Ona",
      age: "Młoda",
      size: "Mała",
      img: "/img/bunia.jpg",
    },
  ];

  return (
    <div>
      

      <section className="hero-section">
        <div className="hero-text">
          <h2>Adoptuj zwierzaka</h2>
          <p>Nasze pupile czekają na Ciebie</p>
          <div className="filters">
              <button type="button" className="active">Pies</button>
              <button type="button">Kot</button>

              <select>
                <option value="">Wielkość</option>
                <option value="Mały">Mały</option>
                <option value="Średni">Średni</option>
                <option value="Duży">Duży</option>
              </select>

              <select>
                <option value="">Wiek</option>
                <option value="Młody">Młody</option>
                <option value="Dorosły">Dorosły</option>
                <option value="Senior">Senior</option>
              </select>

              <select>
                <option value="">Płeć</option>
                <option value="On">On</option>
                <option value="Ona">Ona</option>
              </select>

              <button type="submit" className="search-button">Szukaj</button>
            </div>
        </div>
        <img src="/img/dog-cat-hero.jpg" alt="dog and cat" className="hero-img" />
      </section>

      <section className="about-section">
        <h3>O NAS</h3>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt...
        </p>
        <img src="/cat-dog-side.png" alt="cat and dog" className="about-img" />
      </section>

      <section className="adoption-section">
        <h3>Pupile do adopcji</h3>
        <div className="animal-list">
          {animals.map((a, i) => (
            <AnimalCard
              key={i}
              name={a.name}
              gender={a.gender}
              age={a.age}
              size={a.size}
              img={a.img}
            />
          ))}
        </div>
        <button className="more-button">ZOBACZ WIĘCEJ ZWIERZAKÓW</button>
      </section>
    </div>
  );
};

export default Home;
